import './index_body.css';

import React, { useEffect } from 'react';
import Particles from 'react-particles-js';

const Index_body = () =>{
	return(
		<React.Fragment>
			<div className="index_body">
				<Particles
    				params={{
    					"particles": {
	        				"number": {
	            				"value": 100
	        				},
	        				"size": {
	            				"value": 2
	        				},
	    				},
	    				"interactivity": {
	        				"events": {
	            				"onhover": {
	                				"enable": true,
	                				"mode": "repulse"
	            				}
	        				}
	    				}
					}}
				/>
			</div>
		</React.Fragment>
	);
}

export default Index_body;
